import React from 'react';
import { BsArrowRight } from "react-icons/bs";
import Slider from 'infinite-react-carousel';

const SimpleSlider = () => (
    <Slider dots>
        <div>
            <h3>1</h3>
        </div>
        <div>
            <h3>2</h3>
        </div>
        <div>
            <h3>3</h3>
        </div>
        <div>
            <h3>4</h3>
        </div>
        <div>
            <h3>5</h3>
        </div>
    </Slider>
);


export default SimpleSlider;
